const handleSubmit = e => {
    e.preventDefault()
}

const SnakeForm = () => {
    return(
        <form onSubmit={handleSubmit}>
            <label> Speed :
                <fieldset id="speed">
                    <label> Hard
                        <input type="radio" value="100" name="speed" />
                    </label>
                    <label> Medium
                        <input type="radio" value="300" name="speed" checked/>
                    </label>
                    <label> Easy
                        <input type="radio" value="500" name="speed" />
                    </label>
                </fieldset>
            </label>
        </form>
    )
}
export default SnakeForm;
